import React from 'react';
import { Routes, Route } from 'react-router-dom';
import {
    Home,
    MyStash,
    AddFabric
  } from "./components";

const Main = () => (
    <main>
      <Routes>
        <Route path="/" exact element={<Home/>} />
        <Route path="/myStash/" element={<MyStash/>} />
        <Route path="/addFabric/" element={<AddFabric/>} />
      </Routes>
    </main>
  )

  export default Main;
